@beyonce made a special appearance at the celebration of a partnership that will provide stable permanent housing to 31 Houstonians without homes. The Houston Housing Authority agency is working with Bread Of Life, Inc to repurpose the “Knowles-Rowland Center for Youth” and transform it into housing for our unsheltered friends in the HTX community. So many organizations contributed to this effort, including HHA which provided 31 housing vouchers for the residents. This nearly $7 million dollar investment will sustain the funding for these people to remain housed in a safe and uplifting environment.

Today we commemorate the endeavor of rebuilding the Knowles-Rowland House.

